import React, { useState, useEffect } from 'react';
import { Box, ButtonGroup, Button, Heading, HStack, Flex, Image, Stack, Text, Avatar,
  Step, StepDescription, StepIcon, StepIndicator, StepNumber, StepSeparator, StepStatus, StepTitle, Stepper, useSteps, useColorModeValue,
} from '@chakra-ui/react';
import { useRecoilState } from 'recoil';
import { formDataState, fetchedDataState } from '../../components/recoilAtoms';
import Form1 from './form1';
import Form2 from './form2';
import Form3 from './form3';
import Form4 from './form4';
import jsPDF from 'jspdf'

const steps = [
  { title: 'Customer', description: 'Contact Details' },
  { title: 'Model', description: 'Vehicle Selection' },
  { title: 'Confirmation', description: 'Finance' },
];

export default function Manitou() {

  // ------- print pdf --------
  function ModifyPdf() {

    const doc = new jsPDF();
    const img = 'data:image/jpeg;base64,'

    // base sheet
    var width = doc.internal.pageSize.getWidth()
    var height = doc.internal.pageSize.getHeight()
    doc.addImage(img, 'JPEG', 0, 0, width, height);

    // Set the font size and text alignment for form field values
    doc.setFontSize(9);

    // Fill in the form field values
    doc.text(36, 53, `${formData.name}`); // Name field
    doc.text(38, 60, `${formData.address}`); // Address field
    doc.text(134, 53, `${formData.phone}`); // Phone field
    doc.text(134, 60, `${formData.email}`); // Email field


    doc.text(39, 102, `${formData.stockNum}`); // StockNum field
    // motor
    doc.text(37, 92, `${formData.model}`); // Accessories field
    doc.text(156, 102, `${formData.trade}`); // Trade field

    // second page
    doc.addPage("letter");
    var width2 = doc.internal.pageSize.getWidth()
    var height2 = doc.internal.pageSize.getHeight()

    const img2 = 'data:image/jpeg;base64,'

    doc.addImage(img2, 'JPEG', 0, 0, width2, height2);
    doc.setFontSize(9);
    doc.text(57, 28, `${fetchedData.msrp}`); // Accessories field
    doc.text(46, 37, `${formData.stockNum}`); // StockNum field
    doc.text(110, 37, `${formData.motor}`);

    doc.text(48, 155, `${fetchedData.freight}`);
    doc.text(48, 170, `${formData.licensingMan}`);
    doc.text(48, 184, `${formData.BEandTR}`);

    doc.text(115, 155, `${formData.licensingManTr}`);
    doc.text(115, 169, `${fetchedData.trailer}`);
    doc.text(115, 184, `${formData.tireTaxMan}`);

    doc.text(185, 155, `${fetchedData.nmma}`);
    doc.text(185, 167, `${fetchedData.engineFreight}`);
    doc.text(185, 177, `${fetchedData.enginePreRigPrice}`);
    doc.text(185, 188, `${fetchedData.engineRigging}`);

    // model options 
    // optional equip
    // accessories
    // model total 
    // fees total 
    // pre tax 
    // grand total

    // Save the filled PDF document
    doc.save((`${formData.name}.pdf`));
  };

  //-----------
  const [step, setStep] = useState(1);
  const [progress, setProgress] = useState(0);
  const [formData, setFormData] = useRecoilState(formDataState);
  const [fetchedData, setFetchedData] = useRecoilState(fetchedDataState);

  useEffect(() => {
    if (formData.model) {
      fetchData();
    }
  }, [formData.model]);

  const handleBack = () => {
    setStep(step - 1);
    setProgress(progress - 33.33);
  };

  const handleNext = () => {
    if (step === 4) {
      // Navigate to the CanAm2 page
    } else {
      setStep(step + 1);
      setProgress(progress + 33.33);
      if (step === 2) {
        fetchData();
      }
    }
  };

  const { activeStep } = useSteps({
    index: step - 1, // Adjust the index to match the step
    count: 4, // Total number of steps
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const fetchData = () => {
    fetch(`http://localhost:3001/api/boats/${formData.model}`)
      .then((response) => response.json())
      .then((data) => {
        setFetchedData(data);
      })
      .catch((error) => {
        console.error('Error:', error.message);
      });
  };

  console.log(formData);
  console.log(fetchedData);
  return (
    <>
    <form>
      <Box borderWidth="1px"
        rounded="lg"
        shadow="1px 1px 3px rgba(0,0,0,0.3)"
        maxWidth={800}
        p={6}
        m="10px auto"
        as="form">
        <Stepper size="lg" index={activeStep}>
          {steps.map((step, index) => (
            <Step key={index}>
              <StepIndicator>
                <StepStatus
                  complete={<StepIcon />}
                  incomplete={<StepNumber />}
                  active={<StepNumber />}
                />
              </StepIndicator>

              <Box flexShrink="0">
                <StepTitle>{step.title}</StepTitle>
                <StepDescription>{step.description}</StepDescription>
              </Box>
              <StepSeparator />
            </Step>
          ))}
        </Stepper>
        {step === 1 ? <Form1 /> : step === 2 ? <Form2 /> : step === 3 ? <Form3 /> : <Form4 />}
        <ButtonGroup mt="5%" w="100%">
          <Flex w="100%" justifyContent="space-between">
            <Flex>
              <Button
                onClick={handleBack}
                isDisabled={step === 1}
                colorScheme="teal"
                variant="solid"
                w="7rem"
                mr="5%">
                Back
              </Button>
              <Button
                w="7rem"
                isDisabled={step === 4}
                onClick={handleNext}

                colorScheme="teal"
                variant="outline">
                Next
              </Button>
            </Flex>
            {step === 4 ? (
              <Button
                w="7rem"
                colorScheme="red"
                variant="solid"
                onClick={ModifyPdf}
              >
                Print
              </Button>
            ) : null}
          </Flex>
        </ButtonGroup>
      </Box>

      <Box w="100%" textAlign={'center'} fontWeight="normal" mb="2%"
        borderWidth="1px"
        rounded="lg"
        shadow="1px 1px 3px rgba(0,0,0,0.3)"
        maxWidth={800}
        p={6}
        m="10px auto"
        as="form">

        <HStack spacing={6}>

          <Box w="100%" h="100%"
            bg={useColorModeValue('white', 'gray.800')}
            boxShadow={'2xl'}
            rounded={'md'}
            overflow={'hidden'}>
            <Image
              h={'120px'}
              w={'full'}
              src={
                'https://www.manitoupontoonboats.com/content/manitou/en_ca/_jcr_content/root/heroblock_988604825.coreimg.jpeg/1683827729435/manitou-my23-campaign-image3bckrnd2-16x9-rgb.jpeg'
              }
              objectFit={'cover'}
            />
            <Flex justify={'center'} mt={-12}>
              <Avatar
                size={'xl'}
                src={
                  'https://images.unsplash.com/photo-1500648767791-00dcc994a43e?ixlib=rb-1.2.1&q=80&fm=jpg&crop=faces&fit=crop&h=200&w=200&ixid=eyJhcHBfaWQiOjE3Nzg0fQ'
                }
                alt={'Author'}
                css={{
                  border: '2px solid white',
                }}
              />
            </Flex>

            <Box p={6}>
              <Stack spacing={0} align={'center'} mb={5}>
                <Heading fontSize={'2xl'} fontWeight={500} fontFamily={'body'}>

                </Heading>
                <Text color={'gray.500'}>{formData.name}</Text>
              </Stack>

              <Text color={'gray.500'}>Phone: {formData.phoneNum}</Text>
              <Text color={'gray.500'}>Email: {formData.email}</Text>
              <Text color={'gray.500'}>Address: {formData.address}</Text>
            </Box>
          </Box>
          <Box
            w="100%"
            height="100%"
            bg={useColorModeValue('white', 'gray.800')}
            boxShadow={'2xl'}
            rounded={'md'}
            overflow={'hidden'}>
            <Image
              h={'120px'}
              w={'full'}
              src={
                'https://www.manitoupontoonboats.com/content/dam/global/en/manitou/my23/photo/lifestyle/MANITOU-MY23-Lifestyle-ShawnJohnson-DSC05616-16x9-RGB.jpg'
              }
              objectFit={'cover'}
            />
            <Box p={6}>
              <Stack spacing={0} align={'center'} mb={5}>
                <Heading fontSize={'2xl'} fontWeight={500} fontFamily={'body'}>

                </Heading>
                <Text color={'gray.500'}>  {formData.model}</Text>
              </Stack>
              <Text color={'gray.500'}>Stock Number: {formData.stockNum}</Text>
              <Text color={'gray.500'}>Year: {formData.year}</Text>
              <Text color={'gray.500'}>Trade: {formData.trade}</Text>
              <Text color={'gray.500'}>Deposit: {formData.deposit}</Text>
              <Text color={'gray.500'}>Labour Hours: {formData.options}</Text>
              <Text color={'gray.500'}>Trade: {formData.trade}</Text>

            </Box>
          </Box>
        </HStack>
      </Box>
      </form>

    </>
  );
}